import TripData from "./TripData";
import "./trip_style.css";


export default function Trip(props){
    function dispalyData(dataList){
        return dataList;
    }
    return(
        <div className="trip">
            <h1>{props.h1}</h1>
            <p></p>
            <div className="trip-card">
                {dispalyData(props.dataList)}
            </div>

        </div>
    );
}
